function minimumMoves(s, d) {
    // Write your code here
    let invalidCharCount = 0;
    let all_characters = s.split("");
    let totalChanges = 0
    for(let i=0;i<all_characters.length;i++){
        if(all_characters[i] === "0"){
            invalidCharCount++;
//             we have reached the invalidCharCount max, so change the last bit to 1
            if(invalidCharCount === d){
                totalChanges++;
                all_characters[i] = "1";
                invalidCharCount = 0;
            }
        } else {
            invalidCharCount = 0;
        }
    }
   return totalChanges;
}

let input = "";
let result = minimumMoves(input,158995);
